	static String _CIPHER = Ciphers.cipher[0].cipher;
	static String alphabet = Ciphers.alphabet(_CIPHER);
	
	
	String ciphertext;
	String assignments;
	
	public float homophoneScore;
	
	public void expressGenome() {
		String [] exp = expressGenome(this.genome);
		ciphertext = exp[0];
		assignments = exp[1];
	}
	public static String[] expressGenome(int[] genome) {
		int index = 0;
		String ciphertext = "";
		String assignments = "";
		for (int i=0; i<_CIPHER.length(); i++) {
			char ch = _CIPHER.charAt(i);
			if (isWildcard(ch)) {
				if (genome[index] < alphabet.length()) { // allow for nulls when genome value goes beyond alphabet array
					char a = alphabet.charAt(genome[index++]);
					ciphertext += a;
					assignments += a;
				} else {
					assignments += ' ';
				}
			} else ciphertext += ch;
		}
		return new String[] {ciphertext, assignments};
	}
	
	public static boolean isWildcard(char ch) {
		return ch == '+';
	}

	public String getCiphertext() {
		return ciphertext;
	}

	public void setCiphertext(String ciphertext) {
		this.ciphertext = ciphertext;
	}
	public String getAssignments() {
		return assignments;
	}
	public void setAssignments(String assignments) {
		this.assignments = assignments;
	}
	
	public static void writeem() {
		for (int i=0; i<ciphers.length; i++) {
			FileUtil.writeText("/Users/doranchak/projects/zodiac/zkdecrypto-lite/cipher/wildcard-tests/wildcards-" + i + ".txt", ciphers[i]);
		}
	}
	public static void main(String[] args) {
		writeem();
	}
	
	
